"""**2. Perulangan** ***while***

Perulangan while digunakan ketika dibutuhkan suatu kondisi tertentu untuk menjalankan perulangan.
Dalam hal ini, akan ada dua kemungkinan:

1.   program tidak berjalan karena kondisi tidak terpenuhi
2.   program terus berjalan tanpa henti karena kondisi selalu terpenuhi

Yang perlu diwaspadai disini adalah poin ke-2. Karena hal ini dapat membuat program diluar kendali hingga menghabiskan resource dan membuat komputer freeze atau error.

Untuk menghindari hal tersebut, kita perlu mengikuti beberapa aturan dalam membuat perulangan. Antara lain:

1.   menentukan kondisi/nilai awal sebelum perulangan
2.   menentukan kondisi/nilai akhir sebagai syarat perulangan
3.   melakukan perubahan kondisi secara berkala (dari kondisi/nilai awal menuju kondisi/nilai akhir) dalam perulangan atau menentukan kondisi baru (if) untuk menghentikan perulangan dengan menggunakan kata kunci break.

Contoh 1
"""

kapasitas_ember = 1000
air_dalam_ember = 0

while air_dalam_ember < kapasitas_ember:
    air_dalam_ember += 100
    print("Ember terisi sebanyak:", air_dalam_ember )

print("Ember sudah penuh")

